tables.table_schema:
CREATE TABLE RobotLocationHistory (
    robot_id INT,
    location VARCHAR(255),
    usage_start_time TIMESTAMP,
    usage_end_time TIMESTAMP
);

CREATE TABLE robots (
    id INT PRIMARY KEY,
    robot_name VARCHAR(50) NOT NULL,
    location VARCHAR(100),
    usage_history TEXT
);

CREATE TABLE warehouse (
    id INT PRIMARY KEY,
    warehouse_name VARCHAR(50) NOT NULL,
    location VARCHAR(100),
    temperature FLOAT
);

CREATE TABLE robots (
    id SERIAL PRIMARY KEY,
    robot_name VARCHAR(50) NOT NULL,
    location VARCHAR(50) NOT NULL,
    in_use BOOLEAN
);

CREATE TABLE robot_usage_history (
    usage_id SERIAL PRIMARY KEY,
    robot_id INT REFERENCES robots(id),
    usage_timestamp TIMESTAMP NOT NULL,
    usage_description TEXT
);

CREATE TABLE warehouse_locations (
    location_id SERIAL PRIMARY KEY,
    location_name VARCHAR(50) NOT NULL,
    location_description TEXT
);

CREATE TABLE Robots (
  robot_id INT PRIMARY KEY,
  robot_name VARCHAR(50),
  location_id INT,
  last_maintenance_date DATE
);

CREATE TABLE Locations (
  location_id INT PRIMARY KEY,
  location_name VARCHAR(50),
  aisle_number INT,
  shelf_number INT
);

CREATE TABLE UsageHistory (
  history_id INT PRIMARY KEY,
  robot_id INT,
  start_time DATETIME,
  end_time DATETIME
);

CREATE TABLE MaintenanceLogs (
  log_id INT PRIMARY KEY,
  robot_id INT,
  maintenance_date DATE,
  maintenance_type VARCHAR(50)
);
